window.bookSummaryJSON = "<p><b>Five… minutes. That's how long I was supposed to be there. Get in, get out. Job done.</b></p> <p>Four… guns pointed at my head. It wasn't supposed to go down this way.</p> <p>Three… years old, and she clung to her mum as we sat huddled together on the floor, chained to the pipes on the wall.</p> <p>Two… choices, when my time finally came. To let it all play out or fight with everything I had.</p> <p>One… split second that changed the course of my life… forever.</p> <p>My name is Tyler Evans. They call me The Thief. But on that day, the last thing I expected to become was the hostage.</p> <p>The Thief <i>is a dark standalone romance set in the Soldiers of Anarchy world. You do not need to listen to the other books in the series to enjoy this story. For mature listeners.</i></p>"; 
